import React from "react";
import ReactDOM from "react-dom";

function Card(props) {
  return (
    <div className="my_style">
    <h2>{props.name}</h2>
    <img src={props.img} alt="avatar_img" />
    <p>{props.tel}</p>
    <p>{props.email}</p>
    </div>
  );

};


ReactDOM.render(


  document.getElementById("root")
);
